import React, { useState, useEffect } from 'react';

function List() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Obtener el token de Local Storage
    const storedToken = localStorage.getItem('token');

    // Comprobar si el token se encuentra en Local Storage
    if (storedToken) {
      // Realizar una solicitud GET a la URL deseada con el token en el encabezado de autorización
      fetch('http://localhost:8000/form', {
        headers: {
          Authorization: `${storedToken}`,
        },
      })
        .then((response) => {
          if (!response.ok) {
            throw new Error('La solicitud no fue exitosa');
          }
          return response.json();
        })
        .then((data) => {
          // Al recibir la respuesta, actualizar el estado con los datos
          setData(data);
        })
        .catch((error) => {
          console.error('Error al obtener los datos:', error);
        });
    }
  }, []);

  return (
    <div>
      <h1>Lista de datos:</h1>
      <ul>
        {data.map((item) => (
          <li key={item.id}>{item.nombre}</li>
        ))}
      </ul>
    </div>
  );
}

export default List;
